import axios from "axios";
import fs from "fs";

const html = `
        <html>
            <head>
              <style>
              .certificate {
                --color-blue: #1B60C8;
                --font-title: bold 48px/61px 'Space Grotesk', Arial;
                --font-medium-lh: 36px;
                --font-medium: 600 30px/var(--font-medium-lh) 'Inter', Arial;
                margin: 0;
                padding: 33px;
                box-sizing: border-box;
                width: 800px;
                height: 800px;
                background: #fff;
                color: var(--color-blue);
              }
              .certificate__container{
                padding: 31px 42px 42px;
                width: 100%;
                height: 100%;
                box-sizing: border-box;
                border-radius: 12px;
                border: 1px solid var(--color-blue);
              }
              .certificate__top-row{
                display: flex;
                justify-content: space-between;
                margin-bottom: 24px;
              }
              .certificate__title{
                font: var(--font-title);
                text-transform: uppercase;
                flex: 0 0 auto;
                margin-right: 20px;
              }
              .certificate__date{
                font: var(--font-title);
                flex: 0 0 auto;
              }
              .certificate__username{
                font: var(--font-medium);
                height: var(--font-medium-lh);
                overflow: hidden;
                text-overflow: ellipsis;
              }
              .certificate__surname{
                font: var(--font-medium);
                height: var(--font-medium-lh);
                overflow: hidden;
                text-overflow: ellipsis;
              }
              .certificate__medal{
                height: 352px;
                width: auto;
                margin: 25px auto 0;
                display: block;
              }
              .certificate__bottom-row{
                margin-top: 11px;
                display: flex;
                align-items: flex-end;
                justify-content: space-between;
              }
              .certificate__platform-name{
                font: var(--font-title);
              }
              .certificate__platform-qr-container{
                display:flex;
                align-items: center;
                justify-content: center;
                width: 112px;
                height: 112px;
                overflow: hidden;
                padding-bottom: 13px;
              }
              .certificate__platform-qr{
                display:block;
                width: 112px;
                height: 112px;
              }
            </style>
            </head>
            <body class="certificate">
              <div class="certificate__container">
                <div class="certificate__top-row">
                  <div class="certificate__title">certificate</div>
                  <div class="certificate__date">courseEndDate</div>
                </div>
                <div class="certificate__username">studentName</div>
<!--                <div class="certificate__surname">Surname</div>-->
                <img class="certificate__medal" src="data:image/png;base64," alt="medal" />
                <div class="certificate__bottom-row">
                  <div class="certificate__platform-name">
                    courseTitle
                  </div>
                  <div class="certificate__platform-qr-container">
                    <img class="certificate__platform-qr" src="imageSource" />
                  </div>
                </div>
              </div>
            <script></script>
            </body>
        </html>

`

axios
    .post(
        "https://pdf-and-image-generator.herokuapp.com/generate",
        {
            html: html,
            imgConfig: {
                clip: {
                    x: 0,
                    y: 0,
                    width: 800,
                    height: 800
                }
            },
            pdfConfig: {
                width: 800,
                height: 800,
            }
        }
    )
    .then(function(response) {
        console.log(response.data.data.imageBuffer.data);
        fs.writeFileSync("./image.png", Buffer.from(response.data.data.imageBuffer) || "");
        fs.writeFileSync("./image.pdf", Buffer.from(response.data.data.pdfBuffer) || "");
    })
    .catch(function(error) {
        console.log(error);
    })
